import ReactDOM from 'react-dom';
import { BrowserRouter } from 'react-router-dom';
import App from './App';
import reportWebVitals from './reportWebVitals';

ReactDOM.render(
    <BrowserRouter>
      <main>
            <Switch>
                <Route path="/" exact component={Auth} />
                <Route path="/googlefailure" exact render={(props) => {
                    return <Auth error={"It seems that you have signed up with a password. Please login using your email and password."}/>
                }}/>
                <Route path="/home" exact render={(props) => {
                    return <div className="body">
                        <Home />
                    </div>
                }}/>
                <Route path="/admin" exact render={(props) => {
                    return <div className="body">
                        <AdminDashboard />
                    </div>
                }}/>
                <Route path="/apply" exact render={(props) => {
                    return <div className="body">
                        <ApplyTutor />
                    </div>
                }}/>
                <Route path="/tutorDashboard" exact render={(props) => {
                    return <div className="body">
                        <TutorDashboard />
                    </div>
                }}/>
            </Switch>
        </main>
      <App />
    </BrowserRouter>,
    document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
